import React from "react";
import { APIProvider, Map } from "@vis.gl/react-google-maps";
import Header from "../../components/Header/Header";
import Footer from "../../components/Footer/Footer";
// Optional: import SchoolList from "../../components/SchoolsList/SchoolList";

const LeaderboardPage = () => {
  const apiKey = process.env.REACT_APP_GOOGLE_MAPS_API_KEY;

  return (
    <>

      <Header /* userData and setUserData if you have them */ />
      <APIProvider apiKey={apiKey} onLoad={() => console.log("Maps API loaded")}>
        <div style={{ width: "100%", height: "100%", borderRadius: 12, overflow: "hidden", margin: "16px 0" }}>
          <Map
            defaultCenter={{ lat: 32.0853, lng: 34.7818 }} // Tel Aviv
            defaultZoom={8}
            gestureHandling={"greedy"}
            disableDefaultUI={false}
            mapId={undefined}
          />
        </div>
      </APIProvider>
      {/* <SchoolList /> */}
      <Footer />
    </>
  );
};

export default LeaderboardPage;
